import React from 'react';

interface OfferingCard {
  id: number;
  title: string;
  description: string;
  image: string;
  isCenter?: boolean;
}

const OurOfferings: React.FC = () => {
  const offerings: OfferingCard[] = [
    {
      id: 1,
      title: "Smart Progress Tracking",
      description: "Monitor student progress with detailed analytics and insights that help you identify individual and collective strengths. Our comprehensive tracking journey with detailed analytics and insights that help you track your progress across all programs.",
      image: "https://images.unsplash.com/photo-1522071820081-009f0129c71c?w=400&h=300&fit=crop"
    },
    {
      id: 2,
      title: "Collaborative Learning Spaces",
      description: "Connect with peers worldwide in virtual study rooms where you can share resources, discuss concepts, and solve problems together.",
      image: "https://images.unsplash.com/photo-1552664730-d307ca884978?w=500&h=350&fit=crop",
      isCenter: true
    },
    {
      id: 3,
      title: "Smart Progress Tracking",
      description: "Monitor student progress with detailed analytics and insights that help you identify individual and collective strengths. Our comprehensive tracking journey with detailed analytics and insights that help you track your progress across all programs.",
      image: "https://images.unsplash.com/photo-1573164713714-d95e436ab8d6?w=400&h=300&fit=crop"
    }
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 to-gray-100 py-16 px-4 overflow-hidden">
      <div className="max-w-7xl mx-auto">
        {/* Header */}
        <div className="text-center mb-16">
          <h1 className="text-5xl font-bold text-gray-800 mb-4">
            Our <span className="text-emerald-400">Offerings</span>
          </h1>
          <p className="text-gray-600 text-lg max-w-3xl mx-auto">
            Discover how Bidyut is transforming education and industry through innovative robotics solutions
          </p>
        </div>

        {/* Curved Cards Layout */}
        <div className="relative">
          {/* Background curved shape */}
          <div className="absolute inset-0 flex justify-center items-center">
            <div className="w-full h-96 bg-white rounded-[50px] shadow-2xl transform perspective-1000 rotateX-12"></div>
          </div>

          {/* Cards Container */}
          <div className="relative z-10 flex justify-center items-center min-h-[600px]">
            <div className="flex items-center justify-center space-x-8 transform perspective-1000">
              
              {/* Left Card */}
              <div className="transform rotate-y-12 translate-z-20">
                <div className="bg-white rounded-2xl shadow-xl p-6 w-80 h-96 flex flex-col transform hover:scale-105 transition-all duration-300 hover:shadow-2xl">
                  <div className="h-48 rounded-xl overflow-hidden mb-4">
                    <img 
                      src={offerings[0].image} 
                      alt={offerings[0].title}
                      className="w-full h-full object-cover"
                    />
                  </div>
                  <h3 className="text-xl font-semibold text-gray-800 mb-3 text-center">
                    {offerings[0].title}
                  </h3>
                  <p className="text-gray-600 text-sm leading-relaxed text-center flex-grow">
                    {offerings[0].description.substring(0, 150)}...
                  </p>
                </div>
              </div>

              {/* Center Card (Larger) */}
              <div className="transform translate-z-40 scale-110">
                <div className="bg-white rounded-2xl shadow-2xl p-8 w-96 h-[450px] flex flex-col transform hover:scale-105 transition-all duration-300 hover:shadow-3xl border-2 border-emerald-100">
                  <div className="h-56 rounded-xl overflow-hidden mb-6">
                    <img 
                      src={offerings[1].image} 
                      alt={offerings[1].title}
                      className="w-full h-full object-cover"
                    />
                  </div>
                  <h3 className="text-2xl font-bold text-gray-800 mb-4 text-center">
                    {offerings[1].title}
                  </h3>
                  <p className="text-gray-600 leading-relaxed text-center flex-grow">
                    {offerings[1].description}
                  </p>
                </div>
              </div>

              {/* Right Card */}
              <div className="transform -rotate-y-12 translate-z-20">
                <div className="bg-white rounded-2xl shadow-xl p-6 w-80 h-96 flex flex-col transform hover:scale-105 transition-all duration-300 hover:shadow-2xl">
                  <div className="h-48 rounded-xl overflow-hidden mb-4">
                    <img 
                      src={offerings[2].image} 
                      alt={offerings[2].title}
                      className="w-full h-full object-cover"
                    />
                  </div>
                  <h3 className="text-xl font-semibold text-gray-800 mb-3 text-center">
                    {offerings[2].title}
                  </h3>
                  <p className="text-gray-600 text-sm leading-relaxed text-center flex-grow">
                    {offerings[2].description.substring(0, 150)}...
                  </p>
                </div>
              </div>

            </div>
          </div>

          {/* Additional Visual Effects */}
          <div className="absolute top-20 left-10 w-32 h-32 bg-emerald-200 rounded-full opacity-20 animate-pulse"></div>
          <div className="absolute bottom-20 right-10 w-24 h-24 bg-blue-200 rounded-full opacity-20 animate-pulse delay-1000"></div>
          <div className="absolute top-40 right-20 w-16 h-16 bg-purple-200 rounded-full opacity-20 animate-pulse delay-500"></div>
        </div>

        {/* Bottom CTA Section */}
        <div className="text-center mt-16">
          <button className="bg-emerald-500 hover:bg-emerald-600 text-white font-semibold py-4 px-8 rounded-full text-lg transition-all duration-300 transform hover:scale-105 hover:shadow-lg">
            Explore All Offerings
          </button>
        </div>
      </div>

      {/* Custom Styles for 3D effects */}
      <style jsx>{`
        .perspective-1000 {
          perspective: 1000px;
        }
        .rotateX-12 {
          transform: rotateX(12deg);
        }
        .rotate-y-12 {
          transform: rotateY(12deg);
        }
        .-rotate-y-12 {
          transform: rotateY(-12deg);
        }
        .translate-z-20 {
          transform: translateZ(20px);
        }
        .translate-z-40 {
          transform: translateZ(40px);
        }
        .shadow-3xl {
          box-shadow: 0 35px 60px -12px rgba(0, 0, 0, 0.25);
        }
      `}</style>
    </div>
  );
};

export default OurOfferings;
